          // Start Counter Funktion
        function startCounter(el) {

            setNumbers(el);

            function setNumbers(div) {
                var number = $(div).data('number');
                //var number = divisions.engineering.count;
                var time = number/100*3500;
                if (time < 600) {
                    time = 600;
                }
                countUp(number, time,div);
            }

            function countUp(number,duration,div) {
                var counterVar;
                var counter = 0;
                var delay = 0;
                countLoop();
                function countLoop() {
                    counterVar = setTimeout(function(){
                        setNumberImages(div,counter);
                        counter++;
                        if (delay == 0 ) {
                            delay = duration / number;
                        }
                        if(counter <= number) {
                            countLoop();
                        }
                    }, delay);
                }
            }

            function setNumberImages(div,number) {
                var splitArray = [];
                $(div).text(number);
                splitArray = $(div).text().split('');
                $(div).text('');
                if (splitArray.length == 1) {
                    $(div).append('<div class="number_element number_0"><img src="../files/theme-lilium/images/numbers/number_0.png" title="" alt="four"></div>');
                }
                $.each(splitArray, function (indexInArray, valueOfElement) {
                    $(div).append('<div class="number_element number_'+ valueOfElement +'"><img src="../files/theme-lilium/images/numbers/number_'+ valueOfElement +'.png" title="" alt="four"></div>');
                });
            }
          }

