	function getAllSections() {
		var sections = [];
		$('[data-navcolor]').not('.hidden').each(function(index, el) {
			sections[index] = {
				element: el,
				color: $(el).data('navcolor'),
				offset: $(el).offset().top,
				height: $(el).outerHeight(),
				nextOffset: $(el).offset().top+$(el).outerHeight()-80,
			};
		});
		return sections;
	}

	function isInViewport() {
		/* Reset Classes & Styles */
		//$('.dark-text, .light-text').removeClass('dark-text').removeClass('light-text');
		$('.inView').removeClass('inView');
		$('#header .mod_navigation').removeAttr('style');
		/* Set Classes & Styles */
		$.each(getAllSections(), function(index, val) {
			if ($(window).scrollTop() >= val.offset && $(window).scrollTop() <= val.nextOffset && !$('#header').hasClass('header--nav-open')) {
				$(val.element).addClass('inView');
				if (val.color == '#faf8f6' || val.color == 'dark') {

          $('#header.light-text').removeClass('light-text');
					$('#header').addClass('dark-text');
					if ($(window).width() > 767) {
						$('header #logo img').attr('src', $('header #logo img').data('scrolled')).stop().fadeIn(500);
					} else {
						if ($('#header').hasClass('scrolled')) {
								$('header #logo source').attr('srcset', $('header #logo img').data('scrolled')).stop().fadeIn(500);
						} else {
								$('header #logo source').attr('srcset', $('header #logo img').data('nav-open')).stop().fadeIn(500);
						}
					}
				} else {
          $('#header.dark-text').removeClass('dark-text');
					$('#header').addClass('light-text');
					if ($(window).width() > 767) {
						$('header #logo img').attr('src', $('header #logo img').data('original')).stop().fadeIn(500);
					} else {
						if ($('#header').hasClass('scrolled')) {
								$('header #logo source').attr('srcset', $('header #logo img').data('original')).stop().fadeIn(500);
						} else {
								$('header #logo source').attr('srcset', $('header #logo img').data('original')).stop().fadeIn(500);
						}
					}

				}
				if(val.color == 'dark' || val.color == 'transparent' ) {
					$('#header.scrolled .mod_navigation').css("background-color", "transparent");
				} else {
                  $('#header.scrolled .mod_navigation').css({
                      'background': 'linear-gradient(to bottom, '+hexToRgbA(val.color,1)+' 0%,'+hexToRgbA(val.color,0.6)+' 50%,'+hexToRgbA(val.color,0)+' 100%)'
                  });
				}
			}
		});
	}

    function hexToRgbA(hex,opacity){
        var c;
        if(/^#([A-Fa-f0-9]{3}){1,2}$/.test(hex)){
            c= hex.substring(1).split('');
            if(c.length== 3){
                c= [c[0], c[0], c[1], c[1], c[2], c[2]];
            }
            c= '0x'+c.join('');
            return 'rgba('+[(c>>16)&255, (c>>8)&255, c&255].join(',')+','+opacity+')';
        }
        //throw new Error('Bad Hex');
    }


