$(window).on('load', function(event) {
    if ($('video').attr('autoplay') && $('video').length > 0) {
        $('video')[0].play();
    }

    /* $('body.home #header:not(.scrolled)').delay(100).animate({
        top: '0px',
        opacity: 1
    }, 600, 'easeInOutCubic',function(){}); */

    $('body #header:not(.scrolled)').delay(100).animate({
        top: '0px',
        opacity: 1
    }, 600, 'easeInOutCubic',function(){})

    if($('.threesixty').length > 0 || $('.spritespin').length > 0) {

        $('.threesixty').threeSixty();
        var rangeSlider = document.getElementById('slider-range');
        noUiSlider.create(rangeSlider, {
            start: [0],
            step: 1,
            range: {
                'min': [0],
                'max': [71]
            }
        });

        var slidepos = 0;
        rangeSlider.noUiSlider.on('slide', function(values){
            //$('video')[0].currentTime = values[0];
            let preNumb = parseInt(slidepos);
            let thisNumb = parseInt(values[0]);

            if (preNumb > thisNumb) {
                //console.log(thisNumb-preNumb);
                $('.threesixty').prevFrame();
            } else {
                $('.threesixty').nextFrame();
            }
            slidepos = values[0];
        });
    }

    var lazyLoadInstance = new LazyLoad({
        elements_selector: ".lazy"
        // ... more custom settings?
    });
    $('body').removeClass('fade');
    var simpleParallaxImage = document.getElementsByClassName('simpleParallaxImage');
    if (simpleParallaxImage.length !== 0) {
        new simpleParallax(simpleParallaxImage, {
            // transition: 'cubic-bezier(0.25, 0.1, 0.25, 1)',
            transition: 'none',
            scale: 1.2
        });
    }
    function animateStatement() {
        $('.watch-fullmovie').animate({
            opacity: 1
        }, 1500, 'easeInOutCubic');
        $('.start-statement-wrap').animate({
            top: '0px',
            opacity: 1
        }, 3000, 'easeOutCubic', function() {
            $(this).addClass('animationdone');
            $('.start-statement.statement_1').delay(900).animate({
                bottom: '-250px',
                opacity: 0
            }, 1500, 'easeInCubic');
            $('.start-statement.statement_2').delay(2000).animate({
                bottom: '0',
                opacity: 1,
            }, 1500, 'easeOutCubic');
            $('.watch-fullmovie').delay(1300).animate({
                opacity: 1
            }, 1500, 'easeInOutCubic');


            $('#start-text .link').delay(1300).animate({
              opacity: 1
            }, 1500, 'easeInOutCubic');

            $('.start-statement.statement_1').delay(4000).animate({opacity: 0.95}, 200, function(){
                //$('.start-statement-wrap').removeClass('animationdone');
                //$('.watch-fullmovie').animate({bottom: '-250px',opacity: 0}, 1500, 'easeInCubic');
                $('.start-statement.statement_2').animate({bottom: '-250px',opacity: 0}, 1500, 'easeInCubic', function(){
                    animateStatementReset();
                    animateStatementLoop();
                });

            });
        });
    }

    function animateStatementReset() {
        $('.start-statement.statement_1').removeAttr('style');
        $('.start-statement.statement_1').css('bottom','100%');
        $('.start-statement.statement_2').removeAttr('style');
    }

    function animateStatementLoop() {
        $('.start-statement.statement_1').animate({
            bottom: '0px',
            opacity: 1
        }, 1500, 'easeOutCubic', function() {
            $('.start-statement.statement_1').delay(900).animate({
                bottom: '-250px',
                opacity: 0
            }, 1500, 'easeInCubic');
            $('.start-statement.statement_2').delay(2000).animate({
                bottom: '0',
                opacity: 1,
            }, 1500, 'easeOutCubic');
            $('.watch-fullmovie').delay(1300).animate({
                opacity: 1
            }, 1500, 'easeInOutCubic');

            $('#start-text .link').delay(1300).animate({
              opacity: 1
            }, 1500, 'easeInOutCubic');

            $('.start-statement.statement_1').delay(4000).animate({opacity: 0}, 200, function(){
                $('.start-statement.statement_2').animate({bottom: '-250px',opacity: 0}, 1500, 'easeInCubic', function(){
                    animateStatementReset();
                    animateStatementLoop();
                });

            });

        });
    }

    animateStatement();

    // Career Search
    $('.start-statement--search').keyup(function (e) {
        //console.log('Key');
        if (e.keyCode == 13) {
            //console.log('Enter');
            var offset = $('#jobTable_wrapper').offset();
                        $('html,body').animate({
                            scrollTop: offset.top
                        },1000);
            $('.start-statement--search').val('');
        } else {
            $('#jobTable_filter input').val($('.start-statement--search').val());
            $('#jobTable_filter input').keydown();
            $('#jobTable_filter input').keyup();
        }

    });

    $('.start-statement--search-trigger').click(function (e) {
        e.preventDefault();
        //console.log('After');
        var offset = $('#jobTable_wrapper').offset();
        $('html,body').animate({
            scrollTop: offset.top
        },1000);
        $('.start-statement--search').val('');
    });


});

