function swiperInit(SliderContainer) {
    var initialisiert = false;
    var autoPLAY = false;

    if(SliderContainer !== "landing-page-slider") {
        autoPLAY = {delay: 3500};
    }

    var theSlider = new Swiper('.'+SliderContainer+' .swiper-container', {
        // Optional parameters
        direction: 'horizontal',
        loop: true,
        speed:1000,
        autoplay: autoPLAY,
        keyboard: {
            enabled: true,
        },
        navigation: {
            nextEl: '.'+SliderContainer+' .swiper-button-next',
            prevEl: '.'+SliderContainer+' .swiper-button-prev',
        },
        pagination: {
            el: '.'+SliderContainer+' .swiper-pagination',
            clickable: true,
        },
        on: {
            init: function() {
                initialisiert = true;
            },
            slideChangeTransitionStart : function () {

                if($("."+SliderContainer+" .swiper-slide-active").hasClass("slider-color-black")) {
                    //$("."+SliderContainer+" .headline-container").removeClass("headline-container--white").addClass("headline-container--black");
                    $("."+SliderContainer+" .swiper-pagination").removeClass("swiper-pagination--white").addClass("swiper-pagination--black");
                    $("."+SliderContainer+" .swiper-button-next").removeClass("swiper-button-next--white").addClass("swiper-button-next--black");
                    $("."+SliderContainer+" .swiper-button-prev").removeClass("swiper-button-prev--white").addClass("swiper-button-prev--black");
                }
                else if($("."+SliderContainer+" .swiper-slide-active").hasClass("slider-color-white")) {
                    //$("."+SliderContainer+" .headline-container").removeClass("headline-container--black").addClass("headline-container--white");
                    $("."+SliderContainer+" .swiper-pagination").removeClass("swiper-pagination--black").addClass("swiper-pagination--white");
                    $("."+SliderContainer+" .swiper-button-next").removeClass("swiper-button-next--black").addClass("swiper-button-next--white");
                    $("."+SliderContainer+" .swiper-button-prev").removeClass("swiper-button-prev--black").addClass("swiper-button-prev--white");
                }

                if(windowsWidth <= 768 && initialisiert && SliderContainer === "our-cabin-slider") {
                    $(".our-cabin-txt").css({"opacity": "0"});
                    $(".our-cabin-txt-"+getCurrentSlide()).css({"opacity": "1"});
                }
            },

            slideChangeTransitionEnd : function () {
                refreshLoco();
            }
        }
    });

    function getCurrentSlide() {
        return theSlider.realIndex + 1;
    }
}

