function filterCareers() {
    // Check if on careers
    if (window.location.pathname == "/careers") {
        var division;
        var location;
        var department;
        let params = window.location.search.replace("?","").split("&");
        //console.log(params);
        params.forEach(element => {
            if (element.includes("division")) {
                division = element.replace("division=", "");
            }
            if (element.includes("location")) {
                location = element.replace("location=", "");
            }
            if (element.includes("department")) {
                department = element.replace("department=", "");
            }
        });
        var interNo = 0;
        var intervalstop = false;
        var intervalFunc = setInterval(function(){

            try {
                if (division) {
                    if ($(window).width() > 768) {
                        $(".js_showDivision[data-division='"+division+"']").click();
                    }else {
                        $(".js_showMobileDivision[data-division='"+division+"']").click();
                        setTimeout(function () {
                            $("#job_description_mobile .link").click();
                        }, 650);
                    }
                }else if(location|| department){

                    if ($(window).width() > 768) {
                        $(".js_showDivision").first().click();
                    }else {
                        $(".js_showMobileDivision").first().click();
                        setTimeout(function () {
                            $("#job_description_mobile .link").click();
                        }, 650);
                    }

                    $('#select_division_wrapper .select-items .reset').click();
                }

                setTimeout(() => {
                    if (location)
                    document.querySelector("#jobTable th[data-placeholder='All Locations'] ."+location+"").click();
                }, 100);

                setTimeout(() => {
                    if (department)
                    document.querySelector("#jobTable th[data-placeholder='All Departments'] ."+department+"").click();
                }, 200);
                interNo++
                intervalstop = true;
            }
            catch (erro) {
                console.log(erro);
                intervalstop = false;
            }
            if((intervalstop && $("#jobTable").is(":visible")) || interNo > 3) {
                clearInterval(intervalFunc);
            }

        }, 500);
    }
}
