function control_video_pointer(elem, percIn) {
    var perc = 0;

    if(percIn) perc = percIn;

    //let circle = document.querySelector('.video-duration__percent');
    let circle = elem.parentElement.parentElement.querySelector('.video-duration__percent');
    let radius = circle.r.baseVal.value;
    let circumference = radius * 2 * Math.PI;

    circle.style.strokeDasharray = `${circumference} ${circumference}`;
    //circle.style.strokeDashoffset = circumference;

    let offset = circumference - perc / 100 * circumference;
    circle.style.strokeDashoffset = offset;
}

