function startCounters() {
    setTimeout(() => {
        $('.js_number-counter:not(.counter-finished)').each(function (index, element) {
            let countTo = element.querySelector('p').dataset.counter;
            for (let i = 0; i <= 19; i++) {
                setTimeout(() => {
                    //showCount(element, (countTo - 20 + i), true);
                   countUp(element, countTo, i);
                }, i * 200);

            }
            element.classList.add("counter-finished");
        })
    }, 300);

}

