//var transforms = [0,675,600,525,450,375,300,225,150,75];
var transforms = [750,675,600,525,450,375,300,225,150,75];

function showCount(counter, number, started = false) {

    number.toString().split("").forEach((element, index) => {
        var offset = transforms[element] + 1500;

        counter.querySelectorAll(".counting-block").forEach((block, blockindex )=> {
            if (index == blockindex) {
                /*if (offset == 0 && started) {
                    offset = 750;
                }*/
                block.style.transform = "translateY(-"+offset+"px)";
            }
        });
    });
}

function countUp(element, countTo, index) {
    var from = countTo - (20 - index);
    var to = countTo - (19 - index);
    if (from == 1999) {
    }
    to.toString().split("").forEach((number, i) => {
        if (number !== from.toString().split("")[i]) {
            let block = element.querySelectorAll(".counting-block")[i];
            let transform = parseInt(block.style.transform.replace(/[^0-9]/g,''));
            transform -= 75;
            block.style.transform = "translateY(-"+transform+"px)";
        }
    });
}
